import React, { useState } from "react";
import { Bar, Line, Pie } from "react-chartjs-2";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  LineElement,
  PointElement,
  ArcElement,
  Tooltip,
  Legend,
} from "chart.js";

ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  LineElement,
  PointElement,
  ArcElement,
  Tooltip,
  Legend
);

function Dashboard({ devices = [] }) {
  const [startDate, setStartDate] = useState("2025-01-01");
  const [endDate, setEndDate] = useState("2025-12-31");

  const filtered = devices.filter((d) => {
    if (!d.date) return true;
    const day = new Date(d.date);
    return day >= new Date(startDate) && day <= new Date(endDate);
  });

  const totalKwh = filtered.reduce((sum, d) => sum + Number(d.kWh || 0), 0);

  const chartLabels = filtered.map((d) => d.name);
  const chartData = {
    labels: chartLabels,
    datasets: [
      {
        label: "kWh",
        data: filtered.map((d) => Number(d.kWh || 0)),
        borderWidth: 2,
        backgroundColor: filtered.map((d) =>
          d.status?.toLowerCase() === "on" ? "#28a74588" : "#dc354588"
        ),
        borderColor: filtered.map((d) =>
          d.status?.toLowerCase() === "on" ? "#28a745" : "#dc3545"
        ),
      },
    ],
  };

  const pieData = {
    labels: chartLabels,
    datasets: [
      {
        data: filtered.map((d) => Number(d.kWh || 0)),
        backgroundColor: filtered.map((d) =>
          d.status?.toLowerCase() === "on" ? "#28a74588" : "#dc354588"
        ),
        borderColor: filtered.map((d) =>
          d.status?.toLowerCase() === "on" ? "#28a745" : "#dc3545"
        ),
        borderWidth: 1,
      },
    ],
  };

  const options = {
    maintainAspectRatio: false,
    plugins: {
      tooltip: {
        callbacks: {
          label: function (context) {
            const d = filtered[context.dataIndex];
            return `${d.name}: ${d.kWh} kWh | ${d.device_id} | ${d.user_id} | ${d.address}`;
          },
        },
      },
    },
  };

  return (
    <div className="dashboard-container">
      <h2 className="text-2xl font-bold mb-4">Dashboard</h2>

      <div className="flex gap-4 mb-6">
        <input
          type="date"
          value={startDate}
          onChange={(e) => setStartDate(e.target.value)}
        />
        <input
          type="date"
          value={endDate}
          onChange={(e) => setEndDate(e.target.value)}
        />
      </div>

      <div className="stats mb-6">
        <div className="stat-card">
          <p>Tổng năng lượng</p>
          <p className="font-bold">{totalKwh} kWh</p>
        </div>
        <div className="stat-card">
          <p>Số thiết bị</p>
          <p className="font-bold">{filtered.length}</p>
        </div>
      </div>

      <div className="charts">
        <div className="chart-card">
          <h3>Biểu đồ cột</h3>
          <Bar data={chartData} options={options} />
        </div>
        <div className="chart-card">
          <h3>Biểu đồ đường</h3>
          <Line data={chartData} options={options} />
        </div>
        <div className="chart-card">
          <h3>Pie Chart</h3>
          <Pie data={pieData} options={options} />
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
